    - cssText:
        text: |
          #header {
              background-color: #000000;
              border-bottom: #ef7150 3px solid;
              box-sizing: border-box;
              height: 50px;
          }

          #header .searchbox {
              padding: 5px 10px 0px 10px;
          }

          .top-sticker .noedge {
              top: 56px;
          }
          .pane-frame .pane-header {
              border-bottom: 2px solid #ef7150;
          }

          #header #search-box {
              color: #26262d;
              padding-left: 32px;
              background: white;
          }
  slackNotifier:
    botUser: false
    sendAsText: false
  timestamperConfig:
    allPipelines: false
    elapsedTimeFormat: "'<b>'HH:mm:ss.S'</b> '"
    systemTimeFormat: "'<b>'HH:mm:ss'</b> '"
  upstream:
    globalUpstreamFilterStrategy: UseOldest
  whitelist:
    enabled: false
tool:
  git:
    installations:
    - home: "git"
      name: "Default"
